//Layout
import LayoutAdmin from '../layouts/LayoutAdmin';

//Admin Pages
import AdminHome from '../pages/Admin';
import AdminSignIn from '../pages/Admin/SignIn';

const routes = [
    {
        path: "/admin",
        component: LayoutAdmin,
        routes: [
            {
                path: "/admin",
                component: AdminHome
            },
            {
                path: "/admin/login",
                component: AdminSignIn
            }
        ]
    }
];

export default routes;
